import ReactDOM from "react-dom";

ReactDOM.render(<h1>Dinsha Jaiswal</h1>, document.getElementById("root"));
ReactDOM.render(
  [
    <h1>Dinsha Jaiswal Netflix Pick</h1>,
    <h6>list of 5 Best Series</h6>,
    <ul>
      <li>Dark</li>
    </ul>
  ],
  document.getElementById("root")
);
